eventos.Description:
Retificação sobre o preenchimento de respostas no relatório de certificação no tópico malotes, respondida por mim enquanto certificador. Gostaria de esclarecer quanto a resposta à pergunta no relatório realizada para o certificador: " Durante esse período de guarda do(s) malote(s), quem teve acesso ao local? (Você pode marcar mais de uma opção como resposta).* "
Foram enumeradas as seguintes respostas:
- Coordenador de Local;
- Fiscais;
- Participantes; e
- Assistente.

No entanto, vale ressaltar, que os únicos integrantes que tiveram acesso à sala reservada para a proteção dos malotes(no intervalo entre as 8h-11h da manhã) contendo as provas foram: coordenadora, dois integrantes da equipe de suporte dos correios e certificador, apenas.
Ficando expressa a correção quanto ao tópico anterior assinalado onde havia sido enumerado os integrantes da seguinte forma: 
- Coordenador de Local;
- Fiscais;
- Participantes; e
- Assistente.
Registre-se em ocorrência essa retificação.
